import React from 'react';
import * as IoIcons from 'react-icons/io';
import Navbar from './Navbar';
import styles from './Header.module.css';

const Header = () => {
  return (
    <Navbar>
      <h1 className={styles['header__text']}>Popcorn Club</h1>
      <form className={styles['header__form']}>
        <input
          className={styles['header__input']}
          type="text"
          placeholder="Search..."
        />
        <button className={styles['header__btn']}>
          <IoIcons.IoIosSearch className={styles['header__btn-icon']} />
        </button>
      </form>
      <div className={styles['header__logout']}>
        {/* Could be user's initial name here */}
        <button className={styles['header__logout-btn']}>Log-out</button>
      </div>
    </Navbar>
    // Might be a think border under navbar to divide with a main content.
  );
};

export default Header;
